import React from "react";
import "../App.css";
import SearchBar from "./SearchBar";
import logo from  '../logo_biblioteca.jpg';
import icon_perfil from '../icon_perfil.jpg';
import { Link } from "react-router-dom";
import libro1 from "../imag/el_resplandor.jpg";

function Libros(){
    return(
        <div className="container">
            <div className='logo'> 
                <Link  to="/" class="btn btn-outline-light text-dark" type="button"><img src={logo} width='65' alt= 'Logo'/></Link>
            </div>

            <div className='header'><SearchBar/></div>

            <div className='profile'>    
                <button type="button" class="btn dropdown-toggle btn-outline-light text-dark" data-bs-toggle="dropdown"><img src={icon_perfil} width='65' alt= 'Icon_Perfil'/> </button>
                <div class="dropdown-menu">
                <Link class="dropdown-item" to="/Sign_in">Sign_in</Link>
                <Link class="dropdown-item" to="/Sign_up">Sign_up</Link>

                </div>
            </div>
            <div className="content_libros">
                <div class="card">
                    <img className="card-img-top" src={libro1}/>
                
                </div>
                
                
            </div>
        </div>
       
       
    )
}

export default Libros;
